import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [tasks, setTasks] = useState([]);
  const [newTitle, setNewTitle] = useState('');

  // Fetch tasks from backend
  const fetchTasks = async () => {
    try {
      const res = await axios.get('http://localhost:5000/tasks');
      setTasks(res.data);
    } catch (error) {
      console.error('Error fetching tasks:', error);
    }
  };

  useEffect(() => {
    fetchTasks();
  }, []);

  // Add new task
  const addTask = async () => {
    if (!newTitle.trim()) return;

    try {
      await axios.post('http://localhost:5000/tasks', { title: newTitle });
      setNewTitle('');
      fetchTasks();
    } catch (error) {
      console.error('Error adding task:', error);
    }
  };

  // Toggle task completion
  const toggleComplete = async (task) => {
    try {
      await axios.put(`http://localhost:5000/tasks/${task._id}`, {
        completed: !task.completed,
      });
      fetchTasks();
    } catch (error) {
      console.error('Error updating task:', error);
    }
  };

  // Delete task
  const deleteTask = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/tasks/${id}`);
      fetchTasks();
    } catch (error) {
      console.error('Error deleting task:', error);
    }
  };

  return (
    <div
      style={{
        maxWidth: 600,
        margin: 'auto',
        padding: 20,
        backgroundImage:
          'url(https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=1050&q=80)', // example background image
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        minHeight: '100vh',
        color: '#333',
        fontFamily: 'Arial, sans-serif',
      }}
    >
      <h1 style={{ textAlign: 'center', color: '#fff', textShadow: '1px 1px 4px #000' }}>
        Task App with Features
      </h1>

      <div style={{ display: 'flex', marginBottom: 20 }}>
        <input
          type="text"
          placeholder="New task title"
          value={newTitle}
          onChange={(e) => setNewTitle(e.target.value)}
          style={{
            flexGrow: 1,
            padding: '8px 12px',
            fontSize: 16,
            borderRadius: 4,
            border: '1px solid #ccc',
            marginRight: 8,
          }}
        />
        <button
          onClick={addTask}
          style={{
            padding: '8px 16px',
            fontSize: 16,
            backgroundColor: '#28a745',
            border: 'none',
            borderRadius: 4,
            color: 'white',
            cursor: 'pointer',
          }}
        >
          Add Task
        </button>
      </div>

      <ul style={{ listStyle: 'none', padding: 0 }}>
        {tasks.map((task) => (
          <li
            key={task._id}
            style={{
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'space-between',
              backgroundColor: task.completed ? 'rgba(40, 167, 69, 0.3)' : 'rgba(220, 53, 69, 0.3)',
              marginBottom: 8,
              padding: 10,
              borderRadius: 6,
              boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
            }}
          >
            <div style={{ display: 'flex', alignItems: 'center', flexGrow: 1, cursor: 'pointer' }}>
              <input
                type="checkbox"
                checked={task.completed}
                onChange={() => toggleComplete(task)}
                style={{ marginRight: 12, width: 18, height: 18 }}
              />

              <span
                style={{
                  textDecoration: task.completed ? 'line-through' : 'none',
                  color: task.completed ? '#155724' : '#721c24',
                  fontSize: 18,
                }}
                onClick={() => toggleComplete(task)}
                title="Toggle complete"
              >
                {task.title}
              </span>
            </div>

            <div style={{ textAlign: 'right' }}>
              {task.completedAt && (
                <div style={{ fontSize: 12, color: '#155724', marginBottom: 4 }}>
                  Completed: {new Date(task.completedAt).toLocaleString()}
                </div>
              )}

              <button
                onClick={() => deleteTask(task._id)}
                style={{
                  backgroundColor: '#dc3545',
                  border: 'none',
                  borderRadius: 4,
                  color: 'white',
                  padding: '6px 12px',
                  cursor: 'pointer',
                }}
              >
                Delete
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
